import React from 'react';
import './stats.css'
import { getData } from "./stats/data.js";

function Stats() {
    const [data, setData] = useState(getData());
    return (
       <section className="header">
           
           <div id="pageTitle">
               <h1>Sanitizing Statistics</h1>
           </div>

           <div id="subheader">
               <h2>Total Number Of Doors Sanitized</h2>
           </div>

           <div id="germKill">
               <h3>Total Number Of Germs Killed</h3>
           </div>

           <div id = "deviceStatistics">
                <h4>Device Statistics</h4>
                setData={setData}
                  data={data}
                
           </div>
           
       </section>

    )
}

export default Stats;
